import React, { useEffect } from "react";
import Aos from "aos";
import "aos/dist/aos.css";
import { Container, Row, Col } from "react-bootstrap";

function ContactMe() {

  useEffect(() => {
   Aos.init({duration: 2000});
  }, []);

  return (
    <Container fluid className="contact-me-section" data-aos="fade-down">
      <Container>
        <Row>
          <Col md={8} className="contact-me-description">

          </Col>
        </Row>
      </Container>
    </Container>
  );
}
export default ContactMe;
